import React from "react";

class Search extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            offsearch: "Armed Robbery",
            results: [],
        }
    }

    componentWillMount() {
        let key = sessionStorage.getItem("token");
        let getParam = { method: "GET" };
        let head = { Authorization: `Bearer ${key}` };
        getParam.headers = head;

        const baseUrl = "https://cab230.hackhouse.sh/search?";
        const query = "offence=" + this.state.offsearch;
        const filterlga = "area=Moreton Bay Regional Council";
        // const filterage = "age=" + age;
        // const filtersex = "sex=" + sex;

        let url = baseUrl + query + "&" + filterlga;
        // + "&" + filterage + "&" + filtersex;
        fetch(encodeURI(url), getParam)
            .then(result => {
                return (result.json())
            })
            .then(data => {
                let results = data.result.map((off) => {
                    return (
                        <div key={off.result}>
                            ({off.result.LGA},{off.result.total})
                        </div>
                    )
                })
                this.setState({ results: results })
                console.log(this.state.results);
            })
    }

    Displayingmulti(props) {
        return (
            <div>
                <p>{props.name}</p>
                <p>{props.number}</p>
            </div>
        );
    }

    render() {
        return (
            <div className="offsearch-result">
                {this.state.results.map((offence) => (
                    <Displayingmulti key={offence.LGA} name={offence.LGA} number={offence.total} />
                ))}
            </div>
        );
    };

}

export {Search}
